import { BsChatRightDots } from 'react-icons/bs'
import './App.css';

function App() {
	return (
		<div className="App">
			<div className='header'>
				<div className='chat-logo'>
					<BsChatRightDots size='40px' color='#39a58b' />
					<span>Chat</span>
				</div>
				<div>navbar </div>
			</div>
			<div className='left-block'>search + active contact</div>
			<div className='right-block'>messages</div>
		</div>
	);
}

export default App;
